  false,\n\t\"url\": null,\n\t\"notes\": \"Idaho 2008 305(b) & 303(d) Integrated Report
  - Water Quality. Every two years, DEQ is required by the federal Clean Water Act
  to conduct a comprehensive analysis of Idaho's water bodies to determine whether
  they meet state water quality standards and support beneficial uses or if additional
  pollution controls are needed. This analysis is summarized in an \"Integrated Water
  Quality Monitoring and Assessment Report\" (Integrated Report), which is submitted
  to the U.S. Environmental Protection Agency (EPA) for approval. The report serves
  as a guide for developing and implementing water quality improvement plans (total
  maximum daily loads, or TMDLs) to protect water quality and achieve federal and
  state water quality standards.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
